import React, { Component } from "react";
import LandingPage from "./Components/LandingPage/LandingPage";
import Main from "./Main";
class App extends Component {
  render() {
    return (
      <div className="App">
        <Main />
        <LandingPage />
      </div>
    );
  }
}

export default App;
